import { LoadingButton } from "@mui/lab";
import { Box, loading, Card, Checkbox, Divider, FormControlLabel, FormHelperText, Radio, RadioGroup, Typography } from "@mui/material";
import { Link, useNavigate } from "react-router-dom";
import { useFormik } from "formik";
import * as Yup from "yup";
import useAuth from "hooks/useAuth";
import toast from "react-hot-toast";
import FlexBetween from "components/flexbox/FlexBetween";
import FlexBox from "components/flexbox/FlexBox";
import FlexRowAlign from "components/flexbox/FlexRowAlign";
import AppTextField from "components/input-fields/AppTextField";

const Register = () => {
  const { register } = useAuth();
  const navigate = useNavigate();

  const initialValues = {
    name: "",
    email: "",
    password: "",
    repeatPassword: "",
    userType: "student",
    terms: false,
  };

  const validationSchema = Yup.object().shape({
    name: Yup.string().required("Name is required"),
    email: Yup.string().email("Must be a valid email").max(255).required("Email is required"),
    password: Yup.string().min(6, "Password should be of minimum 6 characters length").required("Password is required"),
    repeatPassword: Yup.string().oneOf([Yup.ref('password'), null], 'Passwords must match').required('Repeat password is required'),
    terms: Yup.boolean().oneOf([true], "You must agree to the terms and conditions"),
  });

  const {
    errors,
    values,
    touched,
    handleBlur,
    handleChange,
    handleSubmit,
  } = useFormik({
    initialValues,
    validationSchema,
    onSubmit: async (values) => {
      try {
        await register(values.email, values.password, values.name);
        toast.success("You registered successfully");
        navigate("/dashboard");
      } catch (error) {
        toast.error("Registration failed. Please try again.");
      }
    },
  });

  return (
    <FlexRowAlign sx={{ flexDirection: "column", height: { sm: "100%" } }}>
      <Card sx={{ padding: 4, maxWidth: 600, boxShadow: 1 }}>
        <FlexRowAlign flexDirection="column" mb={5}>
          <Box width={38} mb={1}>
            <img src="/static/logo/SkinEdu.png" width="100%" alt="Uko Logo" />
          </Box>
          <Typography variant="h5" fontWeight={700} mb={2}>
            Get started with SkinEdu
          </Typography>
        </FlexRowAlign>

        <form noValidate onSubmit={handleSubmit}>
          <FlexBetween flexWrap="wrap">
            <AppTextField
              fullWidth
              name="name"
              type="text"
              label="Name"
              onBlur={handleBlur}
              onChange={handleChange}
              value={values.name}
              error={touched.name && Boolean(errors.name)}
              helperText={touched.name && errors.name}
            />

            <AppTextField
              fullWidth
              name="email"
              type="email"
              label="Email"
              onBlur={handleBlur}
              onChange={handleChange}
              value={values.email}
              error={touched.email && Boolean(errors.email)}
              helperText={touched.email && errors.email}
            />

            <AppTextField
              fullWidth
              name="password"
              type="password"
              label="Password"
              onBlur={handleBlur}
              onChange={handleChange}
              value={values.password}
              error={touched.password && Boolean(errors.password)}
              helperText={touched.password && errors.password}
            />

            <AppTextField
              fullWidth
              name="repeatPassword"
              type="password"
              label="Repeat Password"
              onBlur={handleBlur}
              onChange={handleChange}
              value={values.repeatPassword}
              error={touched.repeatPassword && Boolean(errors.repeatPassword)}
              helperText={touched.repeatPassword && errors.repeatPassword}
            />

            <RadioGroup
              row
              aria-label="userType"
              name="userType"
              value={values.userType}
              onChange={handleChange}
            >
              <FormControlLabel value="student" control={<Radio />} label="Medicine Student" />
              <FormControlLabel value="teacher" control={<Radio />} label="Medicine Teacher" />
            </RadioGroup>

            <FormControlLabel
              control={<Checkbox checked={values.terms} onChange={handleChange} name="terms" />}
              label="I agree to terms & conditions"
            />

            {errors.terms && <FormHelperText error>{errors.terms}</FormHelperText>}

            <Box mt={4}>
              <LoadingButton
                loading={loading}
                fullWidth
                variant="contained"
                type="submit"
                disabled={!values.terms || loading}
              >
                Sign Up
              </LoadingButton>
            </Box>
          </FlexBetween>
        </form>

        <Typography variant="body2" mt={2} color="text.secondary" align="center">
          Already have an account?{' '}
          <Link to="/login" style={{ textDecoration: "none", color: "inherit" }}>
            Login
          </Link>
        </Typography>
      </Card>
    </FlexRowAlign>
  );
};

export default Register;
